    false,nt"url": null,nt"notes": "This is the 1980 Annual Narrative Report
    for Malheur National Wildlife Refuge.  The report begins with general information
    about the refugeu2019s climatic conditions, land acquisition, and system status
    for the year.  Construction and maintenance, including wildfires, are discussed
    in the following section.  Habitat management is covered; habitats include croplands,
    grasslands, wetlands, and forestlands.  The following section describes wildlife.
     Animals of interest include the American Peregrine Falcon, the bald eagle, migratory
    birds, waterfowl, raptors, game mammals, and furbearers.  Interpretation and recreation
    is also discussed.  Finally, the report covers field investigations, cooperative
    programs, and other items of interest.",nt"license_title": "License Not Specified",nt"extras":
